module top_module (
    input clk,
    input reset,
    input enable,
    output [3:0] Q,
    output c_enable,
    output c_load,
    output [3:0] c_d
); //

reg [3:0] temp;

always @(posedge clk)
begin
    if(reset)
        temp <= 4'd0;
    else if(enable)
        temp <= Q + 1;
end

assign c_enable = enable;
assign c_load = reset | (Q == 4'd12 & enable == 1'b1);
assign c_d = 4'b1;

assign Q = temp;

endmodule

